import { Box, Typography } from "@mui/material";
import React, { useContext } from "react";
import { DataBorneContext } from "./ContextBorne";
import Validation from "./Validation";

function PostLogin() {
  const {
    MyBox,
    dataBorne,
    setDataBorne,
    progressBar,
    setprogressBar,
    loginEtat,
    setLoginEtat,
  } = useContext(DataBorneContext);
  return (
    <Box
      sx={{
        display: "flex",
        justifyContent: "center",
        flexDirection: "column",
        p: 2,
        m: 0,

        //backgroundColor: "gray",
        boxShadow: 5,
        borderRadius: 3,
        borderBlockColor: "gray",
        borderBlockWidth: 2,
        textAlign: "center",
        alignContent: "center",
        minWidth: 300,
        maxWidth: 1000,
      }}
    >
      <Typography>Appuyer sur le bouton pour vous connecter</Typography>
      <MyBox>
        <Validation />
      </MyBox>
    </Box>
  );
}

export default PostLogin;
